    false,nt"url": null,nt"notes": "This dataset provides information on budgeted
    appropriations, receipts, and other resources available for each fiscal year starting
    in FY 2010. The data provides granular detail down to the budget organizational
    unit and and object class for the department request, the Governor's recommendation,
    the enacted budget, and the adopted budget.rnrnThe state fiscal year runs from July
    1 to the following June 30 and is numbered for the calendar year in which it ends.
    The State of Iowa operates on a modified accrual basis which provides that encumbrances
    on June 30 must be paid within 60 days after year end. The Legislature may enact
    exceptions to this statute and usually do so for capital items which may run for
    several years.rnrnDepartment names and budget units for FY 2010 - 2015 are based
    on names used in FY 2016.",nt"license_title": "License Not Specified",nt"extras":
